'''Ogress Warriors''' are found in the [[Corsair Cove Dungeon]]. They are a good way for free-to-play [[ironmen]] to obtain [[rune battleaxe]]s and [[rune full helm]]s, as well as law/nature runes.

Note that they have somewhat higher defence than [[lesser demon]]s (especially magical defence), so 45+ ranged or 13+ magic is recommended if you are safespotting.

They can be used as an effective alternative to Ogres for a slayer task, as the [[Corsair Cove Resource Area]] entrance is typically not crowded on P2P worlds.

